import React from 'react'
import HistoryItem from "./HistoryItem";


const HistoryList = ({items}) => {
    return(
        <div>
            <h1>History</h1>
            <div style={{display:'flex'}}>
                <p>{items.x}</p>
                <p>{items.operation}</p>
                <p>{items.y}</p>
                <p>=</p>
                <p>{items.result}</p>
            </div>
            {/*{history.map(i => <HistoryItem item={i}/>)}*/}
        </div>
    )
}
export default HistoryList
